import './hardcoreCalendar.css';
import { HARDCORE_DETAILS } from '../../const.js'

function HardcoreCalendar () {
    return (
        <div>
          {HARDCORE_DETAILS.map((classInfo) => {
              return (
                <div className='container-cc py-1 flex'>

                  <div id='scheduleCard' className='column centercenter'>

                    <div id='WeekODDof4'>
                        <h2 className='classTitle'>{classInfo.topicTitle1}</h2>
                        <div id='optionalTitle' className='subTitle'>
                            <div className='optionalDate'>{classInfo.topicTitle1_date1}</div>
                            <div className='liveTopicdate'>{classInfo.topicTitle1_title1}</div>
                        </div>
                        <div id='liveTopicTitle' className='subTitle'>
                            <div className='optionalDate'>{classInfo.topicTitle1_date2}</div>
                            <div className='liveTopicdate'>{classInfo.topicTitle1_title2}</div>
                        </div>
                    </div>

                    <div id='WeekEVENof4'>
                        <h2 className='classTitle'>{classInfo.topicTitle2}</h2>
                        <div id='optionalTitle' className='subTitle'>
                            <div className='optionalDate'>{classInfo.topicTitle2_date1}</div>
                            <div className='liveTopicdate'>{classInfo.topicTitle2_title1}</div>
                        </div>
                        <div id='liveTopicTitle' className='subTitle'>
                            <div className='optionalDate'>{classInfo.topicTitle2_date2}</div>
                            <div className='liveTopicdate'>{classInfo.topicTitle2_title2}</div>
                        </div>
                    </div>

                  </div>



                </div>
              );
            })}
        </div>
    )
}


export default HardcoreCalendar;
